import React from "react";

const ProjectCard = ({ title, date, concept, imgPath }) => {
  const styles = {
    cardContainer: {
      fontSize: "50px",
    },
  };

  const displayCard = (
    <div className="my-3" style={styles.cardContainer}>
      <div className="row ">
        <div className="col-md-4">
          <img src={imgPath} className="img-fluid rounded-start" alt={title} />
        </div>
        <div className="col-md-8">
          <div className="card-body">
            <div className="">PROJECT</div>
            <div className="">{title}</div>
            <p className="card-text">
              <small className="text-muted">{date}</small>
            </p>
            <p className="card-text">{concept}</p>
          </div>
        </div>
      </div>
    </div>
  );

  return <div>{displayCard}</div>;
};

export default ProjectCard;
